import React, {Component} from 'react';
import logo from './dbs-logo.png';
import HomeScreenButton from './HomeScreenButton';
import './App.css';

class App extends Component {
    render() {
        return (
            <div
                className="App"
                style={{
                    padding: 32,
                }}
            >
                <div className="App-header">
                    <img src={logo} className="App-logo" alt="logo"/>
                    <div
                        style={{
                            borderRadius: 24,
                            backgroundColor: "#ffaaaa",
                            margin: 18,
                        }}
                    >
                        <input
                            placeholder={"What would you like to do today? "}
                            style={{
                                fontSize: 24,
                                margin: 5,
                                borderColor: '#ffffff',
                                flexDirection: 'row',
                                minWidth: 500,
                                height: 32,
                                padding: 5,
                                border: 0,
                                backgroundColor: '#00000000'
                            }}
                        />
                    </div>
                </div>

                <div
                    style={{
                        alignContent: 'center',
                        flex: 1,
                        flexDirection: 'column',
                    }}
                >
                    <p
                        style={{
                            textAlign: 'left',
                            fontSize: 32,
                        }}
                    >
                        Quick Links
                    </p>
                    <div
                        style={{
                            flex: 1,
                            flexDirection: 'row',
                        }}
                    >
                        <HomeScreenButton
                            text={'Hello'}
                            imgSrc={'./icons/account_summary.png'}
                        />
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
